func (ext encodeExtension) DecoratorOfMarshaler(typ reflect2.Type, enc jsoniter.ValEncoder) jsoniter.ValEncoder {
	if typ == marshalerType {
		enc := marshalerEncoder{enc, typ}
		return directMarshalerEncoder{enc}
	}
	if typ.Implements(marshalerType) {
		return marshalerEncoder{enc, typ}
	}
	ptrType := reflect2.PtrTo(typ)
	if ptrType.Implements(marshalerType) {
		ptrEnc := ext.LazyEncoderOf(ptrType)
		enc := marshalerEncoder{ptrEnc, ptrType}
		return referenceEncoder{enc}
	}
	return nil
}

func (ext encodeExtension) DecoratorOfTyper(typ reflect2.Type, enc jsoniter.ValEncoder) jsoniter.ValEncoder {
	if typ.Kind() != reflect.Struct {
		return nil
	}
	if typ.Implements(typerType) {
		return typerEncoder{
			typeEncoder: typeEncoder{ValEncoder: enc},
			typerOf: func(ptr unsafe.Pointer) Typer {
				return typ.UnsafeIndirect(ptr).(Typer)
			},
		}
	}
	ptrType := reflect2.PtrTo(typ)
	if ptrType.Implements(typerType) {
		return typerEncoder{
