func (m ValueMap) Decode(v any) error {
	rv := reflect.ValueOf(v)
	if rv.Kind() != reflect.Ptr {
		return errors.New("cannot unmarshal into a non pointer")
	}
	if rv.IsNil() {
		return errors.New("cannot unmarshal into a nil pointer")
