func NewGraph(c *Config, schemas ...*load.Schema) (g *Graph, err error) {
	defer catch(&err)
	g = &Graph{Config: c, Nodes: make([]*Type, 0, len(schemas)), Schemas: schemas}
	for i := range schemas {
		g.addNode(schemas[i])
	}
	for i := range schemas {
		g.addEdges(schemas[i])
	}
	for _, t := range g.Nodes {
		check(g.resolve(t), "resolve %q relations", t.Name)
	}
	for _, t := range g.Nodes {
		check(t.setupFKs(), "set %q foreign-keys", t.Name)
	}
	for i := range schemas {
		g.addIndexes(schemas[i])
	}
	check(g.edgeSchemas(), "resolving edges")
	aliases(g)
	g.defaults()
	if c.Storage != nil && c.Storage.Init != nil {
		check(c.Storage.Init(g), "storage driver init")
	}
	if enabled, _ := g.Config.FeatureEnabled(FeatureGlobalID.Name); enabled {
		if err := IncrementStartAnnotation(g); err != nil {
			return nil, err
		}
	}
	return
}

